//Function to return a list containing the level order traversal in spiral form.
int l=0;
int height(Node* node)
{
    if (node == NULL)
        return 0;
    else {
         
        // Compute the height of each subtree
        int lheight = height(node->left);
        int rheight = height(node->right);
 
        // Use the larger one
        if (lheight > rheight) {
            return (lheight + 1);
        }
        else {
            return (rheight + 1);
        }
    }
}
// Print nodes at a given level
void printGivenLevel(Node* root, int level, int ltr,vector<int> &ans)
{
    if (root == NULL)
        return;
    if (level == 1)
        ans.push_back(root->data);
 
    else if (level > 1) {
        if (ltr) {
            printGivenLevel(root->left, level - 1, ltr,ans);
            printGivenLevel(root->right, level - 1, ltr,ans);
        }
        else {
            printGivenLevel(root->right, level - 1, ltr,ans);
            printGivenLevel(root->left, level - 1, ltr,ans);
        }
    }
}
void printSpiral(Node* root,vector<int> &ans)
{
    int h = height(root);
    int i;
 

    bool ltr = false;
    for (i = 1; i <= h; i++) {
        printGivenLevel(root, i, ltr,ans);
        ltr = !ltr;
    }
}
 

 


vector<int> findSpiral(Node *root)
{
    //Your code here
    vector<int> ans;
    if(root==NULL)
    {
        return ans;
    }
    
    printSpiral(root,ans);
    return ans;
}

#include <iostream>
#include <vector>

using namespace std;

const int s = 536870913;

int main() {
    int n;
    cin >> n;
    const int mod = n * n * 4;
    vector<int> A(n), B(n), C(n), D(n);
    for (int i = 0; i < n; i++) {
        cin >> A[i] >> B[i] >> C[i] >> D[i];
    }
    vector<pair<int, int>> hashTable(mod, {s, s});
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            int abSum = A[i] + B[j];
            int index = (abSum + s) % mod;

            while (hashTable[index].first != abSum && hashTable[index].second != s) {
                index = (index + 1) % mod;
            }
            if (hashTable[index].second == s) hashTable[index].second = 0;
            hashTable[index] = {abSum, ++hashTable[index].second};
        }
    }

    int cnt = 0;
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            int cdSum = -(C[i] + D[j]);
            int index = (cdSum + s) % mod;

            while (hashTable[index].first != cdSum && hashTable[index].second != s) {
                index = (index + 1) % mod;
            }
            if (hashTable[index].second != s) cnt += hashTable[index].second;
        }
    }

    cout << cnt;

    return 0;
}

function examSchedule(input) {
    let hours = Number(input[0]);
    let minutes = Number(input[1]);
    let dayPart = input[2];
    let hoursAdded = Number(input[3]);
    let minutesAdded = Number(input[4]);

    let result = (hours + hoursAdded) * 60 + minutes + minutesAdded;
    let totalHours = parseInt(result / 60 % 24);
    let totalMinutes = result % 60;

    dayPart = totalHours >= 12 ? (dayPart == "AM" ? "PM" : "AM") : dayPart;
    totalHours -= totalHours > 12 ? 12 : 0;

    console.log(`${totalHours.toString().padStart(2, '0')}:${totalMinutes.toString().padStart(2, '0')}:${dayPart}`);

    return;
}

public class Auth2Controller : Controller
    {
        private readonly SignInManager<ApplicationUser> _signInManager;
        private readonly UserManager<ApplicationUser> _userManager;
        private readonly IMediator _mediator;

        public Auth2Controller(SignInManager<ApplicationUser> signInManager, UserManager<ApplicationUser> userManager, IMediator mediator)
        {
            _signInManager = signInManager;
            _userManager = userManager;
            _mediator = mediator;
        }

        [HttpGet("login/{provider}")]
        public IActionResult LoginWithProvider(string provider, string returnUrl = null, string utm_source = null, string referral = null, int? userType = null)
        {
            if (string.IsNullOrEmpty(provider))
            {
                return BadRequest("Provider name cannot be null or empty.");
            }

            var redirectUrl = Url.Action(nameof(ExternalLogin), new { returnUrl, utm_source, referral });

            var properties = _signInManager.ConfigureExternalAuthenticationProperties(provider, redirectUrl);

            return Challenge(properties, provider);
        }

        [AllowAnonymous]
        [Route("external-signin")]
        public async Task<IActionResult> ExternalLogin(string returnUrl = null, string utm_source = null, string referral = null, int? userType = null)
        {
            var info = await _signInManager.GetExternalLoginInfoAsync();

            //issue with external login, return to login page
            if (info == null)
            {
                Log.Error("Error with external login - info null");
                ModelState.AddModelError("Error", "Something went wrong, please try again");

                return LocalRedirect(returnUrl ?? "/");
            }

            //see if they have a local account.
            var email = info.Principal.FindFirst(ClaimTypes.Email);
            var user = await _userManager.FindByEmailAsync(email?.Value);

            //try and associate with social login
            if (user != null)
            {
                var signInResult = await ExternalLoginSignIn(info.LoginProvider, info.ProviderKey);

                if (signInResult.Succeeded)
                {
                    user.LastLoginDate = DateTimeOffset.Now;
                    //only set the profile image if not set
                    //if (string.IsNullOrEmpty(user.ProfileImagePath) && user.ProfileImage == null)
                    //{
                    //    var profileImageUrl = info.Principal.FindFirst("image")?.Value;
                    //    await SetProfileImageFromSocialLogin(user, profileImageUrl);
                    //}

                    await _userManager.UpdateAsync(user);

                    return LocalRedirect(returnUrl ?? "/");
                }
                else
                {
                    //add external login and confirm email.
                    var result = await _userManager.AddLoginAsync(user, info);
                    user.EmailConfirmed = true;

                    if (result.Succeeded)
                    {
                        signInResult = await ExternalLoginSignIn(info.LoginProvider, info.ProviderKey);

                        if (signInResult.Succeeded)
                        {
                            //await _activityService.AddActivtyAsync(new Activity { ActionType = ActionType.ExternalLogin, Created = DateTime.Now.ToUniversalTime(), CreatedById = user.Id, EntityType = EntityType.NoEntity });

                            ////only set the profile image if not set
                            //if (string.IsNullOrEmpty(user.ProfileImagePath) && user.ProfileImage == null)
                            //{
                            //    var profileImageUrl = info.Principal.FindFirst("image")?.Value;
                            //    await SetProfileImageFromSocialLogin(user, profileImageUrl);
                            //}

                            await _userManager.UpdateAsync(user);

                            return LocalRedirect(returnUrl ?? "/");
                        }
                    }
                }
            }
            else
            {
                var givenName = info.Principal.FindFirst(ClaimTypes.Name)?.Value;

                user = new ApplicationUser {
                    PublicId = Guid.NewGuid().ToString(),
                    Email = email.Value, 
                    UserName = email.Value, 
                    SecurityStamp = Guid.NewGuid().ToString(), 
                    FullName = givenName,
                    CreationDate = DateTime.Now,
                    LastLoginDate = DateTime.Now,
// add additional fields
                };

                //var profileImageUrl = info.Principal.FindFirst("image")?.Value;
                //await SetProfileImageFromSocialLogin(user, profileImageUrl);

                //try and create for user
                await _userManager.CreateAsync(user);

                //add external login and confirm email.
                var result = await _userManager.AddLoginAsync(user, info);

                await _mediator.Send(new AddEmailFlowGroupToUserRequest(user), CancellationToken.None).ConfigureAwait(false);

                if (result.Succeeded)
                {
                    var signInResult = await ExternalLoginSignIn(info.LoginProvider, info.ProviderKey);

                    if (signInResult.Succeeded)
                    {
                        return LocalRedirect(returnUrl ?? "/");
                    }
                }
            }

            //back to login as something went badly wrong!
            Log.Error("Error with external login");
            ModelState.AddModelError("Error", "Something went wrong, please try again");

            return LocalRedirect(returnUrl ?? "/");
        }

        private async Task<Microsoft.AspNetCore.Identity.SignInResult> ExternalLoginSignIn(string loginProvider, string providerKey)
        {
            return await _signInManager.ExternalLoginSignInAsync(loginProvider, providerKey, isPersistent: false, bypassTwoFactor: true);
        }
    }

